import './Card.css';
import pin from '../assets/images/location-dot-solid.svg';

export default function Card(props: any) {
    let maps_location = props.item.attraction.replace()
    return (
        <div className='card'>  
            <img className='card-img' src={require(`../assets/images/${props.item.img}`)} alt="" />
            <div className='text'>
                <div className='location'>
                    <img className='pin' src={pin} alt="" />
                    <span className='location-text'>{props.item.location}</span>
                    <a className='anchor' href='https://google.com/maps/place/${props.item.attraction}'>View in Google Maps</a>
                </div>
                <span className='attraction-name'>{props.item.attraction}</span>
                <span className='dates'>{props.item.date_start} - {props.item.date_end}</span>
                <span className='desc'>{props.item.description}</span>
            </div>
        </div>

    )
}
